import React, { Component } from 'react'

class NameP extends Component {
    constructor(props) {
        super(props)

        this.state = {str: ""};
    }

    nomF(text) {
        console.log(text.currentTarget.value)
        this.setState({str: text.currentTarget})
    }
    prenom(text) {
        console.log(text.currentTarget.value)
        this.setState({str: text.currentTarget})
    }

    render () {
        return (
            <div className="NamePm">
                <label>
                        NOM:
                <input type="text" name="name" value={this.state.str} onChange={(text)=> this.nomF(text)}></input>
                        PRENOM:
                        <input type="text" name="name" value={this.state.str} onChange={(text)=> this.prenom(text)}></input>
                </label>
            </div>
        )
    }
}
export default NameP;
